import React from 'react';
import { AppBar, Toolbar, Typography, Button } from '@mui/material';
import { Link } from 'react-router-dom';

const Header = () => {
  return (
    <AppBar position="sticky">
      <Toolbar>
        <Typography variant="h6" sx={{ flexGrow: 1 }}>
          ТехноСистемы
        </Typography>
        <Button color="inherit" component={Link} to="/">Главная</Button>
        <Button color="inherit" component={Link} to="/about">О компании</Button>
        <Button color="inherit" component={Link} to="/products">Продукты</Button>
        <Button color="inherit" component={Link} to="/services">Услуги</Button>
        <Button color="inherit" component={Link} to="/contact">Контакты</Button>
      </Toolbar>
    </AppBar>
  );
};

export default Header;
